            int type = getArguments().getInt("type");
            
            Builder builder = new AlertDialog.Builder(getActivity());
            builder.setTitle(title);
            builder.setIcon(icon);
            
            switch(type){
            case DIALOG_COMMON_1:
            	final LinearLayout common1 = (LinearLayout)inflator.inflate(R.layout.common_modify, null);
            	builder.setView(common1);
            	break;
            	
            case DIALOG_COMMON_2:
            	final LinearLayout common2 = (LinearLayout)inflator.inflate(R.layout.common_modify, null);
            	((EditText)common2.findViewById(R.id.common_edittext)).setInputType(InputType.TYPE_CLASS_NUMBER);
            	builder.setView(common2);
            	break;
            	
            case DIALOG_ALARM:
            	builder.setItems(R.array.makeroom_alarm_array, new DialogInterface.OnClickListener() {
					public void onClick(DialogInterface dialog, int which) {
						
					}
				});
            	break;
            case DIALOG_LIST_CATEGORY:
            	break;
            case DIALOG_LIST_PUBLIC:
            	builder.setItems(R.array.makeroom_public_array, new DialogInterface.OnClickListener() {
					public void onClick(DialogInterface dialog, int which) {
						
					}
				});
            	break;
            	
            case DIALOG_TIME:
            	Calendar cal = new GregorianCalendar();
            	int hour = cal.get(Calendar.HOUR_OF_DAY);
            	int min = cal.get(Calendar.MINUTE);
            	return new TimePickerDialog(getActivity(), timeSetLintener, hour, min, false);	
            
